import React from 'react'

function MiComponente({rey}) {
  

  return (
    <div>Hola {rey.nombre} come {rey.color} vacas al di {rey.precio},,,, {rey.img}</div>
  )
}
MiComponente.defaultProps={
    reses:"pocas",
    rey:"Rey God"
}

export default MiComponente
